import React from 'react';
import {Grid} from "@mui/material";
import useStyles from "../profile/profile.style";

function Jobs(data) {
    const styles = useStyles();
    console.log(data.JobTitle)
    return (
        <div style={{color: 'white'}}>
            <Grid className={styles.profileGrid} container spacing={2}>

                <Grid className={styles.profile} item xs={5}>

                </Grid>
                <Grid className={styles.profile} item xs={5}>
                    
                </Grid>
            </Grid>
        </div>
    );
}

export default Jobs;
